webpackJsonp([36060460048162],{413:function(a,o){a.exports={data:{site:{siteMetadata:{title:"MAC0215 Blog",author:"Victor Hugo M. Pinto"}},markdownRemark:{id:"/Users/victorhugo/BCC/mac0215-blog/src/pages/padronização-de-campos-V/index.md absPath of file >>> MarkdownRemark",html:'<p>Durante a semana dos dias 07-12 de outubro trabalhamos novamente na padronização dos dados com o objetivo de anonimizar o conteúdo das planilhas de inscritos.</p>\n<p>Cruzamos os dados das colunas <code class="language-text">Se sim, conte-nos quem são:</code> e <code class="language-text">ID</code> da planilha de inscritos de 2016.1 para substituir os nomes dos inscritos pelos seus respectivos IDs, como foi feito em todas as demais planilhas. Essa planilha levou muito mais tempo para ser anonimizada e padronizada pelo grande volume de inscritos (mais de 500).</p>\n<p>Além disso, criamos uma nova coluna em todas as planilhas identificando times por IDs únicos, facilitando a identificação de membros de um mesmo time.</p>\n<p>Durante a semana também iniciamos a geração de visualizações dos dados, com uma primeira versão de um Jupyter Notebook com gráficos da distribuição de gênero nas edições do HackathonUSP. Essa primeira visualização será aprimorada durante a próxima semana e serão criadas outras, cada uma para uma coluna das planilhas.</p>\n<p><strong>Horas</strong>: 10 horas (contabilizando a reunião)</p>',frontmatter:{title:"Padronização de campos (Pt. 5)",date:"October 13, 2018"}}},pathContext:{slug:"/padronização-de-campos-V/",previous:{fields:{slug:"/padronização-de-campos-IV/"},frontmatter:{title:"Padronização de campos (Pt. 4)"}},next:{fields:{slug:"/reunião-11-10/"},frontmatter:{title:"Reunião (11/10)"}}}}}});
